import { Button } from "react-bootstrap";
import { IoBagAdd } from "react-icons/io5";
import Counter from "./Counter";
import "./MenuItem.css";

const MenuItem = ({ name, price }) => {
  return (
    <div className="menu-item-wrapper">
      <div>{name}</div>
      <div>{price}</div>
      <Button variant="light">
        <IoBagAdd />
      </Button>
    </div>
  );
};

export default MenuItem;
